        private void AxShell_DoubleClick(object sender, EventArgs e)
        {
            if (!axShell.InvokeCommandOnSelected(new ShellCommand("default")))
            {
                Sal.MessageBox("Vorgang nicht möglich", "Fehler", Sys.MB_Ok | Sys.MB_IconStop);
            }
        }

        private void AxShell_PathChanged(object sender, EventArgs e)
        {
            this.dfShellOrdner.Text = this.axShell.Path;
            if (Sal.StrLeftX(dfShellOrdner.Text, Sal.StrLength(Var.strPfadArchiv + Sql.Database)) != Var.strPfadArchiv + Sql.Database)
            {
                if (!string.IsNullOrEmpty(Var.strPfadArchiv))
                {
                    axShell.Path = Var.strPfadArchiv + Sql.Database;
                }
            }
        }
